import React from 'react';
import pic from '../assets/img/mypic.jpeg'


const about = () => {
  return (
    <>
      <div className="container emp-profile">
      <form method="">
        <div className="col-md-4">
          <img src={pic} alt="pic"/>


        </div>
      </form>
      </div>

</>
  )
}
export default about
